INSERT INTO `BODYCONTENT` VALUES (557057,'',360451,0),(557058,'\n<ac:layout><ac:layout-section ac:type=\"single\"><ac:layout-cell>\n<ac:structured-macro ac:name=\"tip\"><ac:parameter ac:name=\"title\">Welcome to your new space!</ac:parameter><ac:rich-text-body>\n                    <p>Confluence spaces are great for sharing content and news with your team. This is your home page. Right now it shows recent space activity, but you can customize this page in anyway you like.</p>\n                </ac:rich-text-body></ac:structured-macro><h2>Complete these tasks to get started</h2><ac:task-list>\n<ac:task>\n<ac:task-id>1</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body>\n                        <strong>Edit this home page</strong> - Click <em>Edit</em> in the top right of this screen to customize your Space home page\n                    </ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>2</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body>\n                        <strong>Create your first page</strong> - Click the <em>Create</em> button in the header to get started\n                    </ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>3</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body>\n                        <strong>Brand your Space</strong> - Click <em>Configure Sidebar</em> in the left panel to update space details and logo\n                    </ac:task-body>\n</ac:task>\n<ac:task>\n<ac:task-id>4</ac:task-id>\n<ac:task-status>incomplete</ac:task-status>\n<ac:task-body>\n                        <strong>Set permissions</strong> - Click <em>Space Tools</em> in the left sidebar to update permissions and give others access\n                    </ac:task-body>\n</ac:task>\n</ac:task-list>\n\n<p>&nbsp;</p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"two_equal\"><ac:layout-cell>\n<h2>Recent space activity</h2><p>\n                    <ac:structured-macro ac:name=\"recently-updated\"><ac:parameter ac:name=\"max\">5</ac:parameter><ac:parameter ac:name=\"hideHeading\">true</ac:parameter><ac:parameter ac:name=\"theme\">social</ac:parameter><ac:parameter ac:name=\"types\">page, comment, blogpost</ac:parameter></ac:structured-macro>\n                </p></ac:layout-cell><ac:layout-cell>\n<h2>Space contributors</h2><p>\n                    <ac:structured-macro ac:name=\"contributors\"><ac:parameter ac:name=\"limit\">5</ac:parameter><ac:parameter ac:name=\"scope\">descendants</ac:parameter><ac:parameter ac:name=\"order\">update</ac:parameter><ac:parameter ac:name=\"showLastTime\">true</ac:parameter><ac:parameter ac:name=\"mode\">list</ac:parameter></ac:structured-macro>\n                </p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell>\n<p>&nbsp;</p></ac:layout-cell></ac:layout-section></ac:layout>',360452,2),(557059,'<ac:layout>\n    <ac:layout-section ac:type=\"single\">\n        <ac:layout-cell>\n            <ac:macro ac:name=\"tip\">\n                <ac:parameter ac:name=\"title\">Welcome to your new documentation space!</ac:parameter>\n                <ac:rich-text-body>\n                    <p>This is the home page for your documentation space within Confluence. Documentation spaces are great for keeping technical documentation organised and up to date.</p>\n                </ac:rich-text-body>\n            </ac:macro>\n            <ac:macro ac:name=\"panel\">\n                <ac:parameter ac:name=\"title\">Next you might want to:</ac:parameter>\n                <ac:rich-text-body>\n                    <ac:task-list>\n                        <ac:task>\n                            <ac:task-id>1</ac:task-id>\n                            <ac:task-status>incomplete</ac:task-status>\n                            <ac:task-body>\n                                <strong>Customise the home page</strong>&nbsp;-&nbsp;Click &quot;Edit&quot; to start editing your home page\n                            </ac:task-body>\n                        </ac:task>\n                        <ac:task>\n                            <ac:task-id>2</ac:task-id>\n                            <ac:task-status>incomplete</ac:task-status>\n                            <ac:task-body>\n                                <strong>Check out our sample pages</strong>&nbsp;-&nbsp;Browse the sample pages in the sidebar for layout ideas\n                            </ac:task-body>\n                        </ac:task>\n                        <ac:task>\n                            <ac:task-id>3</ac:task-id>\n                            <ac:task-status>incomplete</ac:task-status>\n                            <ac:task-body>\n                                <strong>Create additional pages</strong>&nbsp;-&nbsp;Click &quot;Create&quot; and choose &quot;Blank Page&quot; to get started\n                            </ac:task-body>\n                        </ac:task>\n                        <ac:task>\n                            <ac:task-id>3</ac:task-id>\n                            <ac:task-status>incomplete</ac:task-status>\n                            <ac:task-body>\n                                <strong>Manage permissions</strong>&nbsp;-&nbsp;Click &quot;Space Tools&quot; and select &quot;Permissions&quot; in the sidebar to manage what users see\n                            </ac:task-body>\n                        </ac:task>\n                    </ac:task-list>\n                </ac:rich-text-body>\n            </ac:macro>\n        </ac:layout-cell>\n    </ac:layout-section>\n    <ac:layout-section ac:type=\"three_equal\">\n        <ac:layout-cell>\n            <h2>Search this documentation</h2>\n            <p>\n                <ac:macro ac:name=\"livesearch\">\n                    <ac:parameter ac:name=\"spaceKey\">RES</ac:parameter>\n                </ac:macro>\n            </p>\n            <h2>Popular Topics</h2>\n            <p>\n                <ac:macro ac:name=\"popular-labels\">\n                    <ac:parameter ac:name=\"count\">10</ac:parameter>\n                    <ac:parameter ac:name=\"spaceKey\">RES</ac:parameter>\n                </ac:macro>\n            </p>\n        </ac:layout-cell>\n        <ac:layout-cell>\n            <h2>Featured Pages</h2>\n            <p>\n                <ac:structured-macro ac:name=\"contentbylabel\">\n                    <ac:parameter ac:name=\"spaces\">RES</ac:parameter>\n                    <ac:parameter ac:name=\"showLabels\">false</ac:parameter>\n                    <ac:parameter ac:name=\"sort\">title</ac:parameter>\n                    <ac:parameter ac:name=\"labels\">featured</ac:parameter>\n                    <ac:parameter ac:name=\"showSpace\">false</ac:parameter>\n                    <ac:parameter ac:name=\"type\">page</ac:parameter>\n                </ac:structured-macro>\n            </p>\n        </ac:layout-cell>\n        <ac:layout-cell>\n            <h2>Recently Updated Pages</h2>\n            <p>\n                <ac:macro ac:name=\"recently-updated\">\n                    <ac:parameter ac:name=\"max\">5</ac:parameter>\n                    <ac:parameter ac:name=\"hideHeading\">true</ac:parameter>\n                    <ac:parameter ac:name=\"theme\">concise</ac:parameter>\n                    <ac:parameter ac:name=\"types\">page</ac:parameter>\n                </ac:macro>\n            </p>\n        </ac:layout-cell>\n    </ac:layout-section>\n</ac:layout>\n',360453,2),(557060,'<ac:layout><ac:layout-section ac:type=\"two_right_sidebar\"><ac:layout-cell><ac:structured-macro ac:name=\"tip\"><ac:rich-text-body><p><span>Here are some tips to get you started. You can edit this page to see how it works!</span></p></ac:rich-text-body></ac:structured-macro><h2>1. Create a page</h2><ul><li>Click &quot;Create&quot; and select &quot;Blank Page&quot; to create your first page.</li><li>New pages are created as children of the page you are currently viewing.</li></ul><h2>2. Add to your page</h2><ul><li>Click &quot;Edit&quot; to enter the Confluence editor and use the page layouts feature to structure your content using sections and columns.</li><li>Use headings to format your text and drag and drop images into your page to provide visual interest.</li><li>Click &quot;Insert&quot; and select &quot;Other Macros&quot; to add macros for navigation, special formatting and other media.</li></ul></ac:layout-cell><ac:layout-cell><ac:structured-macro ac:name=\"panel\"><ac:rich-text-body><p><strong>On this page:</strong></p><p><ac:structured-macro ac:name=\"toc\" /></p></ac:rich-text-body></ac:structured-macro></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell><h2>3. Organise your pages</h2><p>Here are some tips for organising your content.</p><ul><li><h4>Change the page order</h4></li></ul><p style=\"margin-left: 60.0px;\">The sidebar on the left displays your pages in a hierarchy. If you have Space Administrator permissions you can click &quot;Space Tools&quot; &gt; &quot;Reorder Pages&quot; to move pages around.</p><ul><li><h4>Add labels</h4></li></ul><p style=\"margin-left: 60.0px;\">Labels help keep pages organised and make it easier for you to find the information you need. Click &quot;Labels&quot; at the bottom of a page to add or edit. The &quot;Related pages&quot; section on this page uses labels too!</p><ul><li><h4>Make templates</h4></li></ul><p style=\"margin-left: 60.0px;\">Standardise and speed up the page creation process with templates. You can create and format a template with page layouts, standard headings and instructional text for hints and guidelines. Check out our sample page on &quot;<ac:link><ri:page ri:content-title=\"Making a template\" /></ac:link>&quot;</p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell><p><strong>Related pages</strong></p><p><ac:structured-macro ac:name=\"contentbylabel\"><ac:parameter ac:name=\"spaces\"><ri:space ri:space-key=\"RES\" /></ac:parameter><ac:parameter ac:name=\"showLabels\">false</ac:parameter><ac:parameter ac:name=\"sort\">title</ac:parameter><ac:parameter ac:name=\"labels\">documentation-space-sample</ac:parameter><ac:parameter ac:name=\"showSpace\">false</ac:parameter><ac:parameter ac:name=\"type\">page</ac:parameter></ac:structured-macro></p></ac:layout-cell></ac:layout-section></ac:layout>',360454,2),(557061,'<ac:layout>\n    <ac:layout-section ac:type=\"single\">\n        <ac:layout-cell>\n            <p>Give your authors a helping hand by using templates in your documentation space. You will need Space Administrator permissions to create templates.</p>\n            <p>To create a template:</p>\n            <ol>\n                <li>Go to &quot;Space Tools&quot; in the sidebar, select &quot;Content Tools&quot; and create a new template.</li>\n                <li>Click &quot;Page Layout&quot; and add sections and columns to your page.</li>\n                <li>Add headings and sub-headings as needed.</li>\n                <li>Choose &quot;Instructional Text&quot; from the &quot;Template&quot; menu and add text that is only visible in the editor.</li>\n                <li>Save your template.</li>\n            </ol>\n            <p>Your template will become available in the Create dialog for this space.</p>\n        </ac:layout-cell>\n    </ac:layout-section>\n    <ac:layout-section ac:type=\"two_left_sidebar\">\n        <ac:layout-cell>\n            <p><strong>Related pages</strong></p>\n            <p>\n                <ac:structured-macro ac:name=\"contentbylabel\">\n                    <ac:parameter ac:name=\"spaces\">RES</ac:parameter>\n                    <ac:parameter ac:name=\"showLabels\">false</ac:parameter>\n                    <ac:parameter ac:name=\"sort\">title</ac:parameter>\n                    <ac:parameter ac:name=\"labels\">documentation-space-sample</ac:parameter>\n                    <ac:parameter ac:name=\"showSpace\">false</ac:parameter>\n                    <ac:parameter ac:name=\"type\">page</ac:parameter>\n                </ac:structured-macro>\n            </p>\n        </ac:layout-cell>\n        <ac:layout-cell>\n            <ac:structured-macro ac:name=\"info\">\n                <ac:parameter ac:name=\"title\">Useful hint</ac:parameter>\n                <ac:rich-text-body>\n                    <p><em>Confluence Administrators can also make templates that are available across your whole Confluence instance.</em></p>\n                </ac:rich-text-body>\n            </ac:structured-macro>\n        </ac:layout-cell>\n    </ac:layout-section>\n</ac:layout>',360455,2),(557062,'<table><tbody><tr><th>借口哦</th><th>方法</th><th>签名</th><th>是否必填</th></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr></tbody></table>',360458,2),(557063,'<p>22</p>',360460,2),(557065,'<ac:layout>\n    <ac:layout-section ac:type=\"two_right_sidebar\">\n        <ac:layout-cell>\n            <ac:structured-macro ac:name=\"tip\">\n                <ac:rich-text-body>\n                    <p>\n                        <span>Here are some tips to get you started. You can edit this page to see how it works!</span>\n                    </p>\n                </ac:rich-text-body>\n            </ac:structured-macro>\n            <h2>1. Create a page</h2>\n            <ul>\n                <li>Click &quot;Create&quot; and select &quot;Blank Page&quot; to create your first page.</li>\n                <li>New pages are created as children of the page you are currently viewing.</li>\n            </ul>\n            <h2>2. Add to your page</h2>\n            <ul>\n                <li>Click &quot;Edit&quot; to enter the Confluence editor and use the page layouts feature to structure your content using sections and columns.</li>\n                <li>Use headings to format your text and drag and drop images into your page to provide visual interest.</li>\n                <li>Click &quot;Insert&quot; and select &quot;Other Macros&quot; to add macros for navigation, special formatting and other media.</li>\n            </ul>\n        </ac:layout-cell>\n        <ac:layout-cell>\n            <ac:structured-macro ac:name=\"panel\">\n                <ac:rich-text-body>\n                    <p>\n                        <strong>On this page:</strong>\n                    </p>\n                    <p>\n                        <ac:structured-macro ac:name=\"toc\" />\n                    </p>\n                </ac:rich-text-body>\n            </ac:structured-macro>\n        </ac:layout-cell>\n    </ac:layout-section>\n    <ac:layout-section ac:type=\"single\">\n        <ac:layout-cell>\n            <h2>3. Organise your pages</h2>\n            <p>Here are some tips for organising your content.</p>\n            <ul>\n                <li>\n                    <h4>Change the page order</h4>\n                </li>\n            </ul>\n            <p style=\"margin-left: 60.0px;\">The sidebar on the left displays your pages in a hierarchy. If you have Space Administrator permissions you can click &quot;Space Tools&quot; &gt; &quot;Reorder Pages&quot; to move pages around.</p>\n            <ul>\n                <li>\n                    <h4>Add labels</h4>\n                </li>\n            </ul>\n            <p style=\"margin-left: 60.0px;\">Labels help keep pages organised and make it easier for you to find the information you need. Click &quot;Labels&quot; at the bottom of a page to add or edit. The &quot;Related pages&quot; section on this page uses labels too!</p>\n            <ul>\n                <li>\n                    <h4>Make templates</h4>\n                </li>\n            </ul>\n            <p style=\"margin-left: 60.0px;\">\n                Standardise and speed up the page creation process with templates. You can create and format a template with page layouts, standard headings and instructional text for hints and guidelines. Check out our sample page on\n                &quot;<ac:link><ri:page ri:content-title=\"Making a template\" /></ac:link>&quot;\n            </p>\n        </ac:layout-cell>\n    </ac:layout-section>\n    <ac:layout-section ac:type=\"single\">\n        <ac:layout-cell>\n            <p>\n                <strong>Related pages</strong>\n            </p>\n            <p>\n                <ac:structured-macro ac:name=\"contentbylabel\">\n                    <ac:parameter ac:name=\"spaces\">RES</ac:parameter>\n                    <ac:parameter ac:name=\"showLabels\">false</ac:parameter>\n                    <ac:parameter ac:name=\"sort\">title</ac:parameter>\n                    <ac:parameter ac:name=\"labels\">documentation-space-sample</ac:parameter>\n                    <ac:parameter ac:name=\"showSpace\">false</ac:parameter>\n                    <ac:parameter ac:name=\"type\">page</ac:parameter>\n                </ac:structured-macro>\n            </p>\n        </ac:layout-cell>\n    </ac:layout-section>\n</ac:layout>',360462,2),(557066,'<ac:layout><ac:layout-section ac:type=\"two_right_sidebar\"><ac:layout-cell><ac:structured-macro ac:name=\"tip\"><ac:rich-text-body><p><span>Here are some tips to get you started. You can edit this page to see how it works!..</span></p></ac:rich-text-body></ac:structured-macro><h2>1. Create a page</h2><ul><li>Click &quot;Create&quot; and select &quot;Blank Page&quot; to create your first page.</li><li>New pages are created as children of the page you are currently viewing.</li></ul><h2>2. Add to your page</h2><ul><li>Click &quot;Edit&quot; to enter the Confluence editor and use the page layouts feature to structure your content using sections and columns.</li><li>Use headings to format your text and drag and drop images into your page to provide visual interest.</li><li>Click &quot;Insert&quot; and select &quot;Other Macros&quot; to add macros for navigation, special formatting and other media.</li></ul></ac:layout-cell><ac:layout-cell><ac:structured-macro ac:name=\"panel\"><ac:rich-text-body><p><strong>On this page:</strong></p><p><ac:structured-macro ac:name=\"toc\" /></p></ac:rich-text-body></ac:structured-macro></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell><h2>3. Organise your pages</h2><p>Here are some tips for organising your content.</p><ul><li><h4>Change the page order</h4></li></ul><p style=\"margin-left: 60.0px;\">The sidebar on the left displays your pages in a hierarchy. If you have Space Administrator permissions you can click &quot;Space Tools&quot; &gt; &quot;Reorder Pages&quot; to move pages around.</p><ul><li><h4>Add labels</h4></li></ul><p style=\"margin-left: 60.0px;\">Labels help keep pages organised and make it easier for you to find the information you need. Click &quot;Labels&quot; at the bottom of a page to add or edit. The &quot;Related pages&quot; section on this page uses labels too!</p><ul><li><h4>Make templates</h4></li></ul><p style=\"margin-left: 60.0px;\">Standardise and speed up the page creation process with templates. You can create and format a template with page layouts, standard headings and instructional text for hints and guidelines. Check out our sample page on &quot;<ac:link><ri:page ri:content-title=\"Making a template\" /></ac:link>&quot;</p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell><p><strong>Related pages</strong></p><p><ac:structured-macro ac:name=\"contentbylabel\"><ac:parameter ac:name=\"spaces\"><ri:space ri:space-key=\"RES\" /></ac:parameter><ac:parameter ac:name=\"showLabels\">false</ac:parameter><ac:parameter ac:name=\"sort\">title</ac:parameter><ac:parameter ac:name=\"labels\">documentation-space-sample</ac:parameter><ac:parameter ac:name=\"showSpace\">false</ac:parameter><ac:parameter ac:name=\"type\">page</ac:parameter></ac:structured-macro></p></ac:layout-cell></ac:layout-section></ac:layout>',360463,2),(557068,'<p>11</p