h-text-body></ac:structured-macro></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"three_equal\"><ac:layout-cell><h2>Search this documentation</h2><p><ac:structured-macro ac:name=\"livesearch\"><ac:parameter ac:name=\"spaceKey\"><ri:space ri:space-key=\"MIC\" /></ac:parameter></ac:structured-macro></p><h2>Popular Topics</h2><p><ac:structured-macro ac:name=\"popular-labels\"><ac:parameter ac:name=\"count\">10</ac:parameter><ac:parameter ac:name=\"spaceKey\"><ri:space ri:space-key=\"MIC\" /></ac:parameter></ac:structured-macro></p></ac:layout-cell><ac:layout-cell><h2>Featured Pages</h2><p><ac:structured-macro ac:name=\"contentbylabel\"><ac:parameter ac:name=\"spaces\"><ri:space ri:space-key=\"MIC\" /></ac:parameter><ac:parameter ac:name=\"showLabels\">false</ac:parameter><ac:parameter ac:name=\"sort\">title</ac:parameter><ac:parameter ac:name=\"labels\">featured</ac:parameter><ac:parameter ac:name=\"showSpace\">false</ac:parameter><ac:parameter ac:name=\"type\">page</ac:parameter></ac:structured-macro></p></ac:layout-cell><ac:layout-cell><h2>Recently Updated Pages</h2><p><ac:structured-macro ac:name=\"recently-updated\"><ac:parameter ac:name=\"max\">5</ac:parameter><ac:parameter ac:name=\"hideHeading\">true</ac:parameter><ac:parameter ac:name=\"theme\">concise</ac:parameter><ac:parameter ac:name=\"types\">page</ac:parameter></ac:structured-macro></p></ac:layout-cell></ac:layout-section></ac:layout>',360480,2),(557083,'<p>项目名称：microee-s3</p><p>项目端口：19104</p><p>项目分配的ip地址：172.10.11.1,172.10.11.2,172.10.11.3,172.10.11.4</p><p>项目代码：T03</p><p>项目描述：提供统一的文件存储服务，上传、下载、压缩、解压、裁剪、缩略图。各业务系统不必实现文件存储相关业务逻辑。</p><p>项目目标：通过统一文件存储服务暴漏的restapi各业务方可以很快速的将相关功能集成到各业务子项目中。分布式存储服务提供高可用的文件存储、上传、下载等相关功能。</p>',360482,2),(557084,'<p>微服务项目自动生成 microee-gen</p>',360484,2),(557086,'<p>microee-shedlanding</p>',360486,2),(557088,'<p>项目名称: microee-shedlanding</p><p>设计思想: 提供统一的定时任务管理, 集团个业务项目不必在项目里添加定时任务相关代码逻辑和第三方依赖. 通过统一的定时任务管理.</p>',360488,2),(557089,'<p>项目名称: microee-shedlanding</p><p>项目描述: 提供统一的定时任务管理，集团个业务项目不必在项目里添加定时任务相关代码逻辑和第三方依赖。传统项目如果想集成分布式定时任务需增加相关第三方依赖：如elasticjob。如果项目里类似定时任务很多会拖慢项目启动速度。通过统一调度管理减轻项目开发维护工作量。</p>',360489,2),(557091,'<p>microee-s3</p>',360491,2),(557093,'<p>项目名称：microee-s3</p><p>项目端口：19104</p><p>项目分配的ip地址：172.10.11.1,172.10.11.2,172.10.11.3,172.10.11.4</p><p>项目代码：T03</p><p>项目</p>',360493,2),(557095,'<p><strong>按照微服务设计的五原则十二要素，微服务的一个很重要的特点是ip及端口绑定。即各微服务项目有固定的ip地址及端口。</strong></p><h3><em>ip地址及端口分布如下：</em></h3><table><tbody><tr><th>项目名</th><th>项目中文名</th><th>项目描述</th><th colspan=\"1\">ip</th><th>端口</th></tr><tr><td>注册中心</td><td>microee-eureka</td><td>&nbsp;</td><td colspan=\"1\">&nbsp;</td><td>8753</td></tr><tr><td>文档中心</td><td>confluence-wiki</td><td>&nbsp;</td><td colspan=\"1\">&nbsp;</td><td>8090</td></tr><tr><td>项目监控</td><td>microee-admin</td><td>&nbsp;spring boot admin</td><td colspan=\"1\">&nbsp;</td><td>18080</td></tr><tr><td colspan=\"1\">项目门户</td><td colspan=\"1\">microee-main</td><td colspan=\"1\"><span>功能聚合</span></td><td colspan=\"1\">&nbsp;</td><td colspan=\"1\"><span>19100</span></td></tr><tr><td colspan=\"1\"><span>微栈工厂</span></td><td colspan=\"1\">microee-gen</td><td colspan=\"1\"><span>项目自动生成</span></td><td colspan=\"1\">&nbsp;</td><td colspan=\"1\"><span>19101</span></td></tr><tr><td colspan=\"1\"><span>飓风微服务</span></td><td colspan=\"1\">microee-hurricane</td><td colspan=\"1\"><span>基于协议的压测,可提供海量并发请求</span></td><td colspan=\"1\">&nbsp;</td><td colspan=\"1\"><span>19102</span></td></tr><tr><td colspan=\"1\"><span>成员管理</span></td><td colspan=\"1\">microee-membership</td><td colspan=\"1\"><span>提供用户统一管理服务</span></td><td colspan=\"1\">&nbsp;</td><td colspan=\"1\"><span>19103</span></td></tr><tr><td colspan=\"1\"><span>微存储服务</span></td><td colspan=\"1\">microee-s3</td><td colspan=\"1\"><span>管理所有文件上传</span></td><td colspan=\"1\">&nbsp;</td><td colspan=\"1\"><span>19104</span></td></tr><tr><td colspan=\"1\"><span>微调度</span></td><td colspan=\"1\">microee-shedlanding</td><td colspan=\"1\"><span>管理所有定时任务</span></td><td